var PSI_API_KEY = 'AIzaSyATkT38ZKkISigcuhtE5WHj8Lwtr6zK9LE';
var PSI_API_URL = 'https://www.googleapis.com/pagespeedonline/v5/runPagespeed';

function el(selector) {
  return document.querySelector(selector);
}
var website = el('#website');
var form = el('#form');
var types = document.querySelectorAll('input[name="type"]');

form.addEventListener('submit', (e) => {
  e.preventDefault();
  submitForm();
});

Array.from(types).forEach(type => {
  type.addEventListener('change', () => {
    if (!website.value) {
      return;
    }

    submitForm();
  });
});

function submitForm() {
  var type = el('input[name="type"]:checked').value;

  gtag('event', 'search', {'search_term': website.value, 'website_type': type});

  queryPSI(website.value, type, 'mobile');
  queryPSI(website.value, type, 'desktop');
}

function queryPSI(website, type, client) {
  console.log(`Querying PSI for website ${website} and type ${type}`);
  if (!website.startsWith('http')) {
    console.log(`No protocol detected. Prepending "https://" to "${website}"`);
    website = `https://${website}`;
  }

  if (isCached(website, type, client)) {
    var results = getFromCache(website, type, client);
    console.log(`Using results from cache`)
    renderResults(results, client);
    return;
  }

  var parameters = {
    url: encodeURIComponent(`${type}:${website}`),
    strategy: client,
    key: PSI_API_KEY
  };
  var query = `${PSI_API_URL}?`;
  for (key in parameters) {
    query += `${key}=${parameters[key]}&`;
  }
  fetch(query).then(r => r.json()).then(result => {
    console.log('PSI result:', result)
    if (!result.loadingExperience) {
      setError(`No data for ${type}:${website}`);
      return;
    }

    insertIntoCache(website, type, client, result.loadingExperience);
    renderResults(result.loadingExperience, client);
  });
}

function setError(err) {
  gtag('event', 'exception', {'description': err});
  console.error(err);
}

function renderResults(data, client) {
  var FCP = data.metrics.FIRST_CONTENTFUL_PAINT_MS.distributions;
  var fastFCP = FCP[0].proportion;
  var pctFCP = findPercentile(fastFCP, client == 'desktop' ? DESKTOP_FCP : MOBILE_FCP);
  youAreHere('fcp', client, pctFCP);

  var FID = data.metrics.FIRST_INPUT_DELAY_MS.distributions;
  var fastFID = FID[0].proportion;
  var pctFID = findPercentile(fastFID, client == 'desktop' ? DESKTOP_FID : MOBILE_FID);
  youAreHere('fid', client, pctFID);
}

function youAreHere(metric, client, pct) {
  var chart = el(`#${client} .${metric} .chart`);
  var marker = el(`#${client} .${metric} .marker`);
  var rect = chart.getBoundingClientRect();
  var width = rect.width;

  marker.style.display = 'block';
  marker.style.left = `${pct}%`;
}

function findPercentile(pct, quantiles) {
  var high = quantiles.length - 1;
  var low = 0;
  var mid = Math.floor((high - low) / 2) + low;

  while (high - low > 1) {
    if (pct == quantiles[mid]) {
      low = mid;
      high = mid;
    }
    else if (pct < quantiles[mid]) {
      low = mid;
    }
    else if (pct > quantiles[mid]){
      high = mid;
    }
    var previous_mid = mid;
    mid = Math.floor((high - low) / 2) + low;
    if (mid == previous_mid) {
      // No infinite loops.
      break;
    }
  }

  // 1000 quantiles = 10 quantiles for every percentile = 100 percentiles.
  return low / 10;
}

function getCacheKey(website, type, client) {
  return `${website}+${type}+${client}`;
}

function isCached(website, type, client) {
  var key = getCacheKey(website, type, client);
  return key in cache;
}

function getFromCache(website, type, client) {
  var key = getCacheKey(website, type, client);
  return cache[key];
}

function insertIntoCache(website, type, client, value) {
  var key = getCacheKey(website, type, client);
  cache[key] = value;
}
